import * as React from 'react'
import Icon from '../../atoms/Icon';
import Button from '../../atoms/button';



type Props = {
  children?: React.Node,
  className?: string,
  title: string,
  button?: string,
}

const Block = (props: Props): React.Element<*> => {
  return (
    <div class={props.className}>

        <Button />
    </div>
  );
};

Block.defaultProps = {
  className: '',
  children: '',
  title: '',
  button: '',
}

export default Block
